Job Description:
Position: Physician – Gynecologist #710038

Department: Health Services

Reports to: Chief Medical Officer

Location: McDonald/Wright – Jeffrey Goodman Clinic

Compensation: $125.00 per hour, plus $1.50 per hour Shift Differential Premium for hours worked between 6pm-6am

Schedule: During clinic operational hours

Status: 20%, Part-Time, Non-Exempt, Union

90 days

Sick, Vacation, Personal Accruals, and a 403(b) Retirement Plan, and CME Allowance


Building a world where LGBT people thrive as healthy, equal, and complete members of society.

As the nation’s largest and most experienced provider of LGBT medical and mental health services, we help LGBTQ people lead healthier, happier lives, by keeping their minds and body well. All services are free or low cost. We’re also one of the few Federally Qualified Health Centers in the nation with providers who specialize in primary care for LGBTQ people and with a research team working to advance the care and treatment of people in our community.

The Physician – Gynecologist (Gynecologist) position will create lasting change in the health and lives of low-income and underserved LBQ women and transmasculine people through provision of high quality, trauma-informed, body- and sex-positive pelvic care. In this role, the Gynecologist will provide comprehensive outpatient gynecologic care to existing Center clients through in-house referrals. The Gynecologist will perform office-based gynecologic procedures including endometrial biopsies, long-acting reversible contraception and colposcopies. The Gynecologist must have expertise providing pelvic care to people across the gender spectrum and with diverse physical presentations. Additionally, the Gynecologist should have a strong working knowledge of gender affirming hormone therapy including its impacts on pelvic health and the intricacies of gynecologic care for patients living with HIV. The Gynecologist will also provide consultation and education to clinical staff regarding pelvic care in LGBTQIA patients.


1) Works collaboratively with clinic staff to provide high-quality pelvic care;

2) Communicates regularly with primary care providers regarding the pelvic care delivered to patients;

3) Using Center’s Electronic Medical Record, maintains detailed and timely chart notes and codes visits as appropriate for billing purposes;

4) Sees regularly scheduled patients, as well patients with urgent or walk-in pelvic needs;

5) Administers or orders appropriate diagnostic tests;

6) Reviews lab results in a timely manner;

7) Conducts patient communication as needed via phone or patient portal, either directly or through an assistant;

8) Completes prescription refill requests in a timely manner;

9) Provides patient education as required;

10) Completes patient forms and letters in a timely manner;

11) Coordinates with clinical staff to address clients’ social determinants of health, including but not limited to food insecurity, housing instability, employment and transportation;

12) Continually develops and maintains clinical expertise in relevant fields of medicine, including those listed above;

13) Participates in the development and maintenance of health care protocols regarding pelvic and gynecological care at the Center;

14) Provides consultations and education to primary care providers regarding gynecologic care in LGBTQ people;

15) Collaborates with Nursing and Operations to assure a positive patient experience and clinical care;

16) Other duties as assigned;


1) Knowledge of or experience working with the LGBTQ community and familiarity with issues of particular relevance to LGBTQ people;

2) A passion for the Center’s work and its mission to make the world a better place for LGBTQ people;

3) Doctor of Medicine M.D. or Doctor of Osteopathic Medicine D.O. degree with completion of Ob/Gyn residency from an accredited institution;

4) Unrestricted License to practice Medicine in the State of California;

5) Eligibility for malpractice coverage;

6) Board certified or board eligible in Obstetrics and Gynecology;

7) Registered by the federal Drug Enforcement Agency;

8) Current CPR certification;

9) Working knowledge of Allscripts ProEHR, a plus;

10) Bilingual skills, a plus (English/Spanish fluency preferred);

11) Good verbal and written communication skills, including strong organizational, detail, interpersonal and relationship building skills;

12) Demonstrated ability to work effectively with people of diverse races, ethnicities, nationalities, sexual orientations, gender identities, gender expression, socio-economic backgrounds, religions, ages, English-speaking abilities, immigration status, and physical abilities in a multicultural environment.

The Los Angeles LGBT Center is an Equal Opportunity Employer and is committed to fostering diversity within its staff. Applications are encouraged from all persons regardless of their race, color, ancestry, religious creed, national origin, sex, sexual orientation, gender identity, gender expression, medical/physical/mental condition, pregnancy/childbirth and related medical condition, age, marital status, or veteran status.

The Center has implemented a policy requiring all staff to be fully vaccinated against COVID-19 as a condition of employment, subject to applicable federal, state and local laws. For more information, please contact tyamato@lalgbtcenter.org
